DROP TABLE IF EXISTS eroextra_master_erosita,archival_xray,optical_follow_up;
CREATE TABLE eroextra_master_erosita (
    ero_name VARCHAR(255) PRIMARY KEY,
    ero_ra DOUBLE,
    ero_dec DOUBLE,
    ero_poserr DOUBLE,
    ero_flux_erass1 DOUBLE,
    ero_flux_erass2 DOUBLE,
    ero_flux_erass3 DOUBLE,
    ero_flux_erass4 DOUBLE,
    ero_flux_erass5 DOUBLE,
    ero_flux_err_erass1 DOUBLE,
    ero_flux_err_erass2 DOUBLE,
    ero_flux_err_erass3 DOUBLE,
    ero_flux_err_erass4 DOUBLE,
    ero_flux_err_erass5 DOUBLE,
    amplitude DOUBLE,
    significance DOUBLE,
    ero_lcclass DOUBLE,
    ero_date VARCHAR(255),
    nh DOUBLE,
    ero_gamma DOUBLE,
    ero_gamma_err DOUBLE,
    ero_cstat_dof VARCHAR(255),
    ero_flux_mod DOUBLE,
    ero_flux_mod_err DOUBLE
);


CREATE TABLE archival_xray (
    id INTEGER PRIMARY KEY AUTO_INCREMENT,
    ero_name VARCHAR(255) NOT NULL,
    arch_flag DOUBLE,
    arch_date VARCHAR(255),
    arch_flux DOUBLE,
    arch_flux_err DOUBLE,
    arch_instrument VARCHAR(255),
    FOREIGN KEY (ero_name) REFERENCES eroextra_master_erosita(ero_name)
);

CREATE TABLE optical_follow_up (
    id INTEGER PRIMARY KEY AUTO_INCREMENT,
    source_name VARCHAR(255),
    ra_obs DOUBLE,
    dec_obs DOUBLE,
    redshift DOUBLE,
    date VARCHAR(255),
    telescope VARCHAR(255),
    instrument VARCHAR(255)
    -- FOREIGN KEY (ero_name) REFERENCES eroextra_master_erosita(ero_name)
);
